import styled from "@emotion/styled";

const StyledPageHeading = styled.h1`
  font-family: "Roboto", sans-serif;
  font-size: 36px;
  font-weight: 300;
  margin: 0;
  padding: 0;
`;

export { StyledPageHeading };
